app.controller("DashboardController",["$scope","dashboardService",function($scope,dashboardService){dashboardService.success(function(data){$scope.campuses=data}),$scope.campusSelected="East Perth",$scope.campusIs=!1,$scope.buildingIs=!1,$scope.campusSelect=function(campus){$scope.campusSelected=campus.name,$scope.editorURL(),$scope.campusIs=!0},$scope.buildingSelect=function(building){$scope.buildingSelected=building.name,$scope.editorURL(),$scope.buildingIs=!0},$scope.floorSelect=function(floor){$scope.floorSelected=floor.name,$scope.editorURL()},$scope.editorURL=function(){$scope.makeURL="/"+$scope.campusSelected+"/"+$scope.buildingSelected+"/"+$scope.floorSelected+"/",angular.lowercase($scope.makeURL),$scope.makeURL.replace(/\s/g,""),console.log($scope.makeURL)}}]);